import React, { Component } from 'react';
import navbar from './Navbar.css';

class Navbar extends Component {
    render(){
        return(
             navbar = [
                {
                   label:'Home',
                   class:'fas fa-dolly'
                },
                {
                   label:'Sobre',
                   class:'fas fa-dolly',
                },
                {
                   label:'Contato',
                   class:'fas fa-dolly'
                }
             ]
        
          )
    }
    
}
export default Navbar;
